import React, {Component} from 'react';
import {
    Redirect
} from "react-router-dom";


class News extends Component {
    state = {
        is_login:true
    };
    getData = () =>{
        this.setState({
            is_login :false
        })
    };

    componentDidMount() {
        this.getData()
    }

    render() {
        return (
            <div>
                <h2>News页面</h2>
            </div>
        );
    }
}

export default News;
